var firstUpper=function(val){if(val==null){return""}var f=val.substr(0,1).toUpperCase();return f+val.substring(1,val.length)};var tablename2ClassName=function(tablename){var parts=tablename.split("_");var className="";for(var i=0,max=parts.length;i<max;i++){className+=firstUpper(parts[i])}return className};var underlineToCamelCase=function(val){var parts=val.split("_");var CamelCase="";for(var i=0,max=parts.length;i<max;i++){CamelCase+=firstUpper(parts[i])}return CamelCase.substr(0,1).toLocaleLowerCase()+CamelCase.substring(1,CamelCase.length)};var replaceKeys=function(strtemplate,classInfo){var rst=strtemplate;for(k in classInfo){var re=new RegExp("@@"+k+"@@","gm");rst=rst.replace(re,classInfo[k])}return rst};
